$(function(){

    // Закрыть детально для мобилы
    $(".js-target-close-modal").click( function(e){
        $('body').css({"overflow":"visible"});
        $(this).closest(".modal").removeClass("active");
    });

    // Открыть детально для мобилы
    $(".js-target-open-sauna").click( function(e){
        $('body').css({"overflow":"hidden"});
        var modal =  $(".js-target-sauna");
        $(modal).addClass("active");
        var object = JSON.parse($(this).attr('data-sauna'));
        console.log(object);

        // Set Id
        $(modal)
            .find('.js-target-open-order')
            .attr({"data-sauna-id":object.id});

        // Set in order items
        var c = $(modal).find('.item__irows');
        $(c).html("");
        $.each(object.in_order, function(k, v){
            $(c).append('<div class="item__info-key">'+v+'</div>');
        });

        // Set Name
        $(modal)
            .find('.sauna__header')
            .html('<span>'+object.name+'</span> <div class="sauna__status">'+(object.vip?"vip":"")+'</div>');

        // Set price
        $(modal)
            .find('.js-price')
            .html(object.price);

        // Set min hour order
        $(modal)
            .find('.sauna__max-guests')
            .html('мин. заказ ' + object.min_order +' часа');

        // Set over guest count price
        $(modal)
            .find('.sauna__info-more .js-user-price')
            .html( object.over_guest_price );

        // Set max guest
        $(modal)
            .find('.sauna__info-more .js-user-max-guest')
            .html(object.min_guest);

        // Set images
        var c = $(modal).find('.sauna__image');

        var s = "";
        $.each(object.images, function(k, v) {
            s +='<div class="sauna__image-bg" style="background-image: url('+v+')"></div>';
        });

        $(c).html("<div class='slick-slider-block-modal'>"+s+"</div>");

        $('.slick-slider-block-modal').slick({
            arrows: true,
            //lazyLoad: 'ondemand',
            responsive: [
                {
                    breakpoint: 1024,
                    settings: {
                        slidesToShow: 1,
                        slidesToScroll: 1,
                        infinite: true,
                        dots: false,
                        arrows: false
                    }
                }, {
                    breakpoint: 1,
                    settings: {
                        slidesToShow: 1,
                        slidesToScroll: 1,
                        infinite: true,
                        dots: false,
                        arrows: false
                    }
                },
            ]
        });



    });

    $(".js-target-open-order").click( function(e){
        $('body').css({"overflow":"hidden"});
        $(".js-target-sauna").removeClass("active");
        $(".js-target-order").addClass("active");

        var sid = $(this).attr('data-sauna-id');

        $("#current-sauna-id").val(sid).trigger('change');

        $('.js-target-order #sauna_currnt option[value="'+sid+'"]').prop('selected', true);
    });


    $(".modal.active").click( function(e){
        $(".js-target-sauna").addClass("active");
    });
});
window.declOfNum = function(n, titles) {
    return titles[(n % 10 === 1 && n % 100 !== 11) ? 0 : n % 10 >= 2 && n % 10 <= 4 && (n % 100 < 10 || n % 100 >= 20) ? 1 : 2];
}

document.addEventListener("DOMContentLoaded",
    function () {
        var lastStep = 2;
        var step = 0;
        var start_date = new Date();
        var date = start_date.getFullYear() + "-" + (+start_date.getMonth() + 1) + "-" + start_date.getDate();

        updateControls();
        request(date, 23);

        $('.steps-form #js-click-form-next').click(function () {
            console.log(step);
            step++;
            $('.steps-form .step-form.active').removeClass('active');
            $('.steps-form .step-form.step-' + step).addClass('active');
            updateControls();
        });

        $('.steps-form #js-click-form-back').click(function () {
            step--;
            if(step >= 0 ) {
                $('.steps-form .step-form.active').removeClass('active');
                $('.steps-form .step-form.step-' + step).addClass('active');
                updateControls();
            } else {
                step++;
                $(".js-target-order").removeClass("active");
                $("body").css({"overflow":"visible"})
            }
        });

        function updateControls() {
            if (lastStep === step) {
                $('.steps-form #js-click-form-next').hide();
                $('.steps-form #js-click-form-back').show();
            }
            if (lastStep > step) {
                $('.steps-form #js-click-form-next').show();
                $('.steps-form #js-click-form-back').show();
            }

            /*if (0 === step) {
                $('.steps-form #js-click-form-back').hide();
                $('.steps-form #js-click-form-next').show();
            }*/
        }

        /*var picker = $('#datePicker').datetimepicker({
            date: new Date(),
            viewMode: 'YMD',
            firstDayOfWeek: 1,
            language: 'ru',
            onDateChange: function () {
                var d = this.getValue();
                if (d) {
                    date = d.getFullYear() + "-" + (+d.getMonth() + 1) + "-" + d.getDate();
                    getTimeTable();
                } else {
                    reset();
                }
            },
            onClose: function () {
                this.element.remove();
            }
        });*/

       /* $.datetimepicker.setDateFormatter({
            parseDate: function (date, format) {
                var d = moment(date, format);
                return d.isValid() ? d.toDate() : false;
            },
            formatDate: function (date, format) {
                return moment(date).format(format);
            },
        });*/

        jQuery.datetimepicker.setLocale('ru');
        jQuery('#datePicker').datetimepicker({
            startDate: new Date(),
            minDate: new Date(),
            format: 'Y-m-d H:i:s',
            inline: true,
            lang: 'ru',
            timepicker: false,
            onSelectDate: function (ct, $i)  {
                var d = new Date(ct);
                if (d) {
                    date = d.getFullYear() + "-" + (+d.getMonth() + 1) + "-" + d.getDate();
                    getTimeTable();
                } else {
                    reset();
                }
            }
        });

        //new SimpleBar($("#time-table")[0]);
        var nowDay = [];
        var currentTime = "";
        reset();

        $('#current-sauna-id').change(function () {
            console.log('current-sauna-id')
            getTimeTable();
        });

        function getTimeTable() {
            var sauna = $("#current-sauna-id").val();
            reset();
            request(date, sauna);
        }

        function request(date, sauna) {
            $.ajax({
                url: '/wp-admin/admin-ajax.php',
                type: 'POST',
                data: 'action=getFreeOnThisDay&date=' + date + '&sauna=' + sauna,
                beforeSend: function (xhr) {
                    //console.log('Загрузка, 5 сек...');
                },
                success: function (data) {
                    //console.log( data );
                    nowDay = JSON.parse(data);
                    updateTimeTable(JSON.parse(data));
                }
            });
        }

        var clickTimeTableNum = 0;
        var hors = 0;
        var currentReal = "";

        $('#time-table').on('click', '.time-table__row.allowed', function () {

            if (clickTimeTableNum === 0) {
                clickTimeTableNum = 1;
                $('#time-table .time-table__row.current').removeClass('current');
                $(this).addClass('current');
                currentTime = +$(this).attr('data-time');
                currentReal = +$(this).attr('data-real');

            } else {

                clickTimeTableNum = 0;
                $(this).addClass('current');
                var timeB = +$(this).attr('data-time');
                currentRealB = +$(this).attr('data-real');


                //
                if (currentTime < timeB) {
                    var cacheTime = currentTime;
                    currentTime = timeB;
                    timeB = cacheTime;
                }
                hors = currentTime - timeB;
                // Нормализуем, если сначала указали конечное время
                if (hors < 0) {
                    hors *= -1;
                }
                hors += 1;

                for (var i = timeB + 1; i <= currentTime; i++) {
                    $('#time-table .time-table__row').eq(i).addClass('current');
                }


                // Если время указано наоборот
                var currentRealCashe = "";
                if(currentReal > currentRealB) {
                    currentRealCashe = currentReal;
                    currentReal = currentRealB;
                    currentRealB = currentRealCashe;
                }

                hors = (currentRealB - currentReal) / 60 / 60;
                console.log("Заказано на :" + hors, "c " + currentReal, "по  " + currentRealB, (currentRealB - currentReal));

                var error = "";
                if(hors < 2) {
                    error = "<div class='error'>Минимальное время бронирования<br> 2 часа !</div>";
                    $('#js-click-form-next').hide();
                } else {
                    $('#js-click-form-next').show();
                }

                $("#time-table-info").html("Время бронирования " + hors + " часа,  " + window.declOfNum(hors, ['час', 'часа', 'часов']) + error);

                currentTime = timeB;

                $('#view-name').show();
            }

        });

        $("#js-do-order").click(function () {
            //var date = $('#dateVisit').val();
            var sauna = $("#current-sauna-id").val();
            console.log(sauna);
            var hours = hors;

            var name = $("#input-name").val();
            var phone = $("#input-phone").val();

            if(hours < 2) {
                alert('Минимальное время бронирования 2 часа ! Вернитесь на шаг и укажите желаемое время.');
                return false;
            }

            if (date != "" && name != "" && phone != "") {
                $.ajax({
                    url: '/wp-admin/admin-ajax.php',
                    type: 'POST',
                    data: 'action=addOrder&date=' + date + '&sauna=' + sauna + '&currentTime=' + currentReal + "&hours=" + hours + "&phone=" + phone + "&name=" + name,
                    beforeSend: function (xhr) {
                        //console.log('Загрузка, 5 сек...');
                    },
                    success: function (data) {
                        var result = JSON.parse(data);
                        if (result.ok === 1) {


                            var stepform = $('.steps-form');
                            $(stepform).find('.step-form.active').removeClass('active');
                            $('.steps-form #js-click-form-next').hide();
                            $('.steps-form #js-click-form-back').hide();

                            $(stepform).find('.step-form.step-final').addClass('active');
                        } else {
                            alert("Возникла ошибка:" + result.e);
                            console.log(currentReal, date, name, phone, result);
                        }
                    }
                });
            } else {
                alert("Проверьте правильность ввода имени и номера телефона.");
                console.log(currentReal, date, name, phone);
            }
        });

        function reset() {
            currentTime = "";
            nowDay = [];
            $('#time-table').hide();
            $('#view-name').hide();
            $('#js-errore-msg').html("");
        }

        function updateTimeTable(array) {
            $('#time-table').show();
            //var tt = $("#time-table .simplebar-content");
            var tt = $("#time-table");
            if (!array.e) {

                tt.html("");
                for (var i = 0; array.length > i; i++) {
                    var classDiv = "allowed";
                    var text = "Свободно";
                    var time = i;

                    if (i === 48) {
                        tt.append("<div class='time-table__row newday'>Следующий день</div>");
                    }
                    if (time > 47) {
                        time = i - 48;

                    }

                    if (!array[i].test) {
                        var classDiv = "denay";
                        var text = "Занято";
                    }
                    /* tt.append("<div data-time='"+i+"' class='time-table__row "+classDiv+"'><span>"+time+":00</span><span>"+text+"</span></div>"); */


                    tt.append("<div data-time='" + i + "' data-real='" + array[i].time + "' class='time-table__row " + classDiv + "'><span>" + array[i].ftime + "</span></div>");
                }
            } else {
                tt.html("<div class='time-table__row error'>" + array.e + "</div>");
            }
        }
    }
);
